    private static List<string> ProcessFile(string file)
    {
        List<string> results = new();

        foreach (var word in file.SplitLines())
        {
            if (word.Length == 5 || word.Length == 6 || word.Length == 7)
            {
                results.Add(word.ToString());
            }
        }

        return results;
    }

    public List<string> GetAllWords(Model model)
    {
        var words = model.Language switch
        {
            "Spanish" => Spanish.AsQueryable(),
            "English" or _ => English.AsQueryable()
        };

        if (!string.IsNullOrWhiteSpace(model.Pattern))
        {
            var pattern = model.Pattern.Trim().ToUpper();

            if (!pattern.StartsWith('^'))
                pattern = '^' + pattern;
            if (!pattern.EndsWith('$'))
                pattern = pattern + '$';

            var regexp = new Regex(pattern, RegexOptions.Compiled);

            words = words.Where(t => regexp.IsMatch(t));
        }

        if (!string.IsNullOrWhiteSpace(model.AvailableLetters))
        {
            var availableLetters = model.AvailableLetters.Trim().ToUpper();

            words = words.Where(t => t.All(c => availableLetters.Contains(c)));
        }

        if (!string.IsNullOrWhiteSpace(model.RejectedLetters))
        {
            var rejectedLetters = model.RejectedLetters.Trim().ToUpper();

            words = words.Where(t => !t.Any(c => rejectedLetters.Contains(c)));
        }

        if (!string.IsNullOrWhiteSpace(model.ObligatoryLetters))
        {
            var obligatoryLetters = model.ObligatoryLetters.Trim().ToUpper();

            words = words.Where(t => obligatoryLetters.All(c => t.Any(tc => tc == c)));
        }

        return words.ToList();
    }
}

// from https://www.meziantou.net/split-a-string-into-lines-without-allocation.htm
public static class StringExtensions
{
    public static LineSplitEnumerator SplitLines(this string str)
    {
        // LineSplitEnumerator is a struct so there is no allocation here
        return new LineSplitEnumerator(str.AsSpan());
    }

    // Must be a ref struct as it contains a ReadOnlySpan<char>
    public ref struct LineSplitEnumerator
    {
        private ReadOnlySpan<char> _str;

        public LineSplitEnumerator(ReadOnlySpan<char> str)
        {
            _str = str;
            Current = default;
        }

        // Needed to be compatible with the foreach operator
        public LineSplitEnumerator GetEnumerator() => this;

        public bool MoveNext()
        {
            var span = _str;
            if (span.Length == 0) // Reach the end of the string
                return false;

            var index = span.IndexOfAny('\r', '\n');
            if (index == -1) // The string is composed of only one line
            {
                _str = ReadOnlySpan<char>.Empty; // The remaining string is an empty string
                Current = span;
                return true;
            }

            if (index < span.Length - 1 && span[index] == '\r')
            {
                // Try to consume the '\n' associated to the '\r'
                var next = span[index + 1];
                if (next == '\n')
                {
                    Current = span[..index];
                    _str = span[(index + 2)..];
                    return true;
                }
            }

            Current = span[..index];
            _str = span[(index + 1)..];
            return true;
        }

        public ReadOnlySpan<char> Current { get; private set; }
    }
}
